#!/usr/bin/env ruby
# encoding: utf-8

require 'time'

# 这是一个示例Ruby类
class Example
  attr_reader :name, :created_at
  
  # 构造函数
  # @param name [String] 名称
  def initialize(name)
    @name = name
    @created_at = Time.now
  end
  
  # 打印问候语
  def greet
    puts "你好，#{@name}！现在是 #{@created_at.iso8601}。"
  end
  
  # 生成随机数列表
  # @param count [Integer] 数量
  # @return [Array<Integer>] 随机数列表
  def generate_random_numbers(count = 5)
    (1..count).map { rand(1..100) }
  end
end

# 示例使用
if __FILE__ == $0
  example = Example.new("测试用户")
  example.greet
  puts "随机数: #{example.generate_random_numbers}"
end


